import ReactDOM from "react";

function Button({text, id}) {
    const scroll = () => {
        ReactDOM.querySelector('#body').scrollIntoView({behavior: 'smooth'})
      };
  return (
    <button
        className="btn"
        onClick={scroll}
      >
        {text}
    </button>
  );
}

export default Button;
